import flash.events.Event;

stop();

var points = new Array();
var i = 1;
var px, py, px1, py1;
var sp = p1, fp = null, sp1 = p20, fp1 = null;
var sto1, sto2;
var queue = 1;
var pers_b:Array = new Array(santa_b, elf_b, programmer_b, deerrapper_b, snowman_b, bigfoot_b);
var pers_r:Array = new Array(santa_r, elf_r, programmer_r, deerrapper_r, snowman_r, bigfoot_r);

var pers1 = pers_b[pids1[0]-1];

pers1.x = sp.x;
pers1.y = sp.y;
pers1.energy = 10;
pers1.hp = 100;
pers1.damage = 30;
pers1.coins = 0;

var pers2 = pers_r[pids2[0]-1];

pers2.x = sp1.x;
pers2.y = sp1.y;
pers2.energy = 0;
pers2.hp = 100;
pers2.damage = 30;
pers2.coins = 0;

money1.addEventListener(Event.ENTER_FRAME, money1k);
function money1k(e:Event){
	if(pers1.hitTestObject(money1)){
		removeChild(money1);
		pers1.coins += 5;
		money1.removeEventListener(Event.ENTER_FRAME, money1k);
	}

	if(pers2.hitTestObject(money1)){			
		removeChild(money1);
		pers2.coins += 5;
		money1.removeEventListener(Event.ENTER_FRAME, money1k);
	}
}

money2.addEventListener(Event.ENTER_FRAME, money2k);
function money2k(e:Event){
