pers1.addEventListener(MouseEvent.CLICK, fight1);
pers2.addEventListener(MouseEvent.CLICK, fight);
function fight(e:MouseEvent){
	var enemy = e.target;
	if(queue == 2){
		enemy.hp -= pers1.damage;
		queue = 1;
	}
	if(pers2.hp < 0){
		removeChild(pers2);
		pers2 = null;
		pers2.hp = 0;
		pers2.energy = 0;
		pers2.damage = 0;
	}
}

function fight1(e:MouseEvent){
	var enemy = e.target;
	if(queue == 1){
		enemy.hp -= pers2.damage;
		queue = 2;
	}
	if(pers1.hp < 0){
		removeChild(pers1);
		pers1 = null;
		pers1.hp = 0;
		pers1.energy = 0;
		pers1.damage = 0;
	}
}	



stage.addEventListener(Event.ENTER_FRAME, main);
function main(e:Event){
	try{
		px = pers1.x;
		py = pers1.y;

		en1.text = "Energy: " + pers1.energy;
		en2.text = "Energy: " + pers2.energy;

		hp1.text = "Hp: " + pers1.hp;
		hp2.text = "Hp: " + pers2.hp;

		dmg1.text = "Damage: " + pers1.damage;
		dmg2.text = "Damage: " + pers2.damage;

		cn1.text = "Coins: " + pers1.coins;
		cn2.text = "Coins: " + pers2.coins;

		if(pers1.energy > 0)
			if(sto1 < sto2){
				moveP(sto2);
			} else{
				moveP(sto1);
			}

		px1 = pers2.x;
		py1 = pers2.y;
		if(pers2.energy > 0)
			if(sto1 < sto2){
				moveP1(sto2);
			} else{
				moveP1(sto1);
			}

	} catch(err:Error) {

	}

}


stage.addEventListener(MouseEvent.CLICK, getPoint);
function getPoint(e:MouseEvent){
	if(e.target == "[object point]"){
		points = new Array();
		i = 1;
		if(pers1.energy > 0){
			fp = e.target;
			sto1 = sp.name.split('p')[1];
			sto2 = fp.name.split('p')[1];
		}

		if(pers2.energy > 0){
			fp1 = e.target;
			sto1 = sp1.name.split('p')[1];
			sto2 = fp1.name.split('p')[1];
		}

		if(sto1 < sto2){
			for(var ip = sto1; ip <= sto2; ip++){
				points.push(root['p' + ip]);
			}
		} else {
			for(var ip1 = sto1; ip1 >= sto2; ip1--){
				points.push(root['p' + ip1]);
			}
		}
	}



}

function moveP(n){
	var pxb = false, pyb = false;
	var speed = 1;

	if(i <= n){
		if(px != points[i].x){
			if(px < points[i].x){
				pers1.x += speed;
			} else{
				pers1.x -= speed;	
			}
		} else {
			pxb = true;
		}

	}


	if(i <= n){
		if(py != points[i].y){
			if(py < points[i].y){
					pers1.y += speed;
				} else{
					pers1.y -= speed;	
				}
		} else {
			pyb = true;
		}

	}



	if(pxb && pyb){
		pers1.energy--;
		if(pers1.energy <= 0){
			pers2.energy = 10;
			points = new Array();
		}
		i++;
		pxb = false;
		pyb = false;
		sp = fp;
	}
}


function moveP1(n){
	var pxb = false, pyb = false;
	var speed = 1;

	if(i <= n)
		if(px1 != points[i].x){
			if(px1 < points[i].x){
				pers2.x += speed;
			} else{
				pers2.x -= speed;	
			}
		} else {
			pxb = true;
		}

	if(i <= n)
		if(py1 != points[i].y){
			if(py1 < points[i].y){
					pers2.y += speed;
				} else{
					pers2.y -= speed;	
				}
		} else {
			pyb = true;
		}


	if(pxb && pyb){
		pers2.energy--;
		if(pers2.energy <= 0){
			pers1.energy = 10;
			points = new Array();
		}
		i++;
		pxb = false;
		pyb = false;
		sp1 = fp1;
	}
}
